INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000003411005', '待办列表', 'BpmTaskList', '/bpm/core/bpmTask/myList.do', '1', '<div id=\"myTask\" class=\"colId_${colId}\" colId=\"${colId}\">\n	<div class=\"widget-box border \" >\n		<div class=\"widget-body\">\n			<div class=\"widget-scroller\" >\n				<dl class=\"modularBox\">\n					<dt>\n						<h1><em class=\"daiban\"></em>${data.title}</h1>\n						<div class=\"icon\">\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\"  title=\"更多\"/>\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\"  title=\"刷新\"/>\n						</div>\n					</dt>\n					<#list data.obj as obj>\n						<dd>\n                    		    <span class=\"project_01\">\n								<em>■</em>\n                                		<a href=\"${ctxPath}/bpm/core/bpmTask/toStart.do?fromMgr=true&taskId=${obj.id}\" target=\"_blank\">\n                                        			${obj.description}\n                                       	 </a>\n							</span>\n							<span class=\"project_02\">\n								<a href=\"###\">【${obj.name}】</a>\n							</span>\n							<span class=\"project_03\">\n								<a href=\"###\">${obj.createTime?string(\'yyyy-MM-dd\')}</a>\n							</span>\n						</dd>\n					</#list>\n				</dl>\n			</div>\n		</div>\n	</div>\n</div>', 'portalScript.getPortalBpmTask(colId)', 'NO', '1', '1', NULL, '1', NULL, '', '', NULL);
