INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000008039006', '导航信息', 'baseNavInfo', '', '', '<div id=\"navBox\" class=\"colId_${colId}\" colId=\"${colId}\">\n	<div class=\"card_msg\">\n		<ol id=\"cardUl\">			\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>公司违纪举报电话及邮箱</h3>\n					<h2>jichabu@redxun.cn</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>总裁办</h3>\n					<h2>020-26404070 <br/>13602987111</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>总经办</h3>\n					<h2>020-86310367<br/> 18023875131</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>稽查部</h3>\n					<h2>020-86385980 <br/>18023876667</h2>\n				</div>\n			</li>\n			<li class=\"p_top\">\n				<div class=\"cardInfo\">\n					<h3>人事部</h3>\n					<h2>020-86331013<br/> 18053769755</h2>\n				</div>\n			</li>\n			<h1 class=\"clearfix\"></h1>\n		</ol>\n	</div>\n</div>', 'portalScript.getPortalMsgBox(\"msgbox\")', 'NO', '1', '1', NULL, '1', NULL, '', '', NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000008759000', '柱状报表', 'reportCol', '', '', '<div id=\"report\" class=\"colId_${colId} modularBox\" colId=\"${colId}\" style=\"background: #fff;height:450px;width:100%;\">\n<div id=\"zzbb\" style=\"width:560px;height:440px;\" ></div>\n<div class=\"script\">\n <script type=\"text/javascript\">\n        // 基于准备好的dom，初始化echarts实例\n        var myChart = echarts.init(document.getElementById(\'zzbb\'));\n\n        // 指定图表的配置项和数据\n        var option = {\n            title: {\n                text: \'本月销量\'\n            },\n            tooltip: {},\n            legend: {\n                data:[\'销量\']\n            },\n            xAxis: {\n                data: [\"衬衫\",\"羊毛衫\",\"雪纺衫\",\"裤子\",\"高跟鞋\",\"袜子\"]\n            },\n            yAxis: {},\n            series: [{\n                name: \'销量\',\n                type: \'bar\',\n                data: [5, 20, 36, 10, 10, 20]\n            }]\n        };\n\n        // 使用刚指定的配置项和数据显示图表。\n        myChart.setOption(option);\n    </script>\n</div>\n</div>', '', 'NO', '1', '1', NULL, '1', NULL, '', '', NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000011559002', '折线报表图', 'zxbbt', '', '', '<div id=\"zxbbt\" class=\"colId_${colId} \" colId=\"${colId}\" style=\"background: #fff;\">\n<div id=\"zxbbtChart\" style=\"width:100%;height:100%;\" ></div>\n<div class=\"script\">\n <script type=\"text/javascript\">\n        // 基于准备好的dom，初始化echarts实例\n        var zxChart = echarts.init(document.getElementById(\'zxbbtChart\'));\n\n        // 指定图表的配置项和数据\n        var option = {\n            title: {\n                text: \'本月销量\'\n            },\n            tooltip: {},\n            legend: {\n                data:[\'销量\']\n            },\n            xAxis: {\n                data: [\"衬衫\",\"羊毛衫\",\"雪纺衫\",\"裤子\",\"高跟鞋\",\"袜子\"]\n            },\n            yAxis: {},\n            series: [{\n                name: \'销量\',\n                type: \'line\',\n                data: [5, 20, 36, 10, 10, 20]\n            }]\n        };\n\n        // 使用刚指定的配置项和数据显示图表。\n        zxChart.setOption(option);\n    </script>\n</div>\n</div>', '', 'NO', '1', '1', NULL, '1', NULL, '', '', NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000011559004', '曲线报表图', 'qxbbtCol', '', '', '<div id=\"qxbbt\" class=\"colId_${colId}\" colId=\"${colId}\" style=\"background: #fff;\">\n	<div id=\"qxbbtChart\" style=\"min-width:100%;max-width:100%;height:360px;\" ></div>\n	<script type=\"text/javascript\">\n\n		 var resizeMyFn = function(){\n			   var MyDiv = document.getElementById(\"qxbbtChart\");\n			   var MyWidth = document.documentElement.clientWidth || document.body.clientWidth\n			   MyDiv.style.width = MyWidth*0.48+\"px\";\n		  }\n		 resizeMyFn();\n		 \n		// 基于准备好的dom，初始化echarts实例\n		var qxChart = echarts.init(document.getElementById(\'qxbbtChart\'));\n\n		option = {\n			xAxis: {\n				type: \'category\',\n				boundaryGap: false,\n				data: [\'Mon\', \'Tue\', \'Wed\', \'Thu\', \'Fri\', \'Sat\', \'Sun\']\n			},\n			yAxis: {\n				type: \'value\'\n			},\n			series: [{\n				data: [820, 932, 901, 934, 1290, 1330, 1320],\n				type: \'line\',\n				areaStyle: {}\n			}]\n		};\n\n		// 使用刚指定的配置项和数据显示图表。\n		qxChart.setOption(option);\n	   \n		window.onresize = function () { \n			 resizeMyFn();\n			 qxChart.resize();\n		}\n	</script>\n</div>\n', '', 'NO', '1', '1', NULL, '1', NULL, '', '', NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000011559013', '流程方案申请', 'mySolList', '', '', '<div id=\"myDrafts\" class=\"colId_${colId}\" colId=\"${colId}\">\r\n	<div class=\"widget-box border \" >\r\n		<div class=\"widget-body\">\r\n			<div class=\"widget-scroller\" >\r\n				<dl class=\"modularBox\">\r\n					<dt>\r\n						<h1>${data.title}</h1>\r\n						<div class=\"icon\">\r\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\"/>\r\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\"/>\r\n						</div>\r\n						<div class=\"clearfix\"></div>\r\n					</dt>\r\n						<#list data.obj as obj>\r\n						<dd>\r\n							<p><a href=\"${ctxPath}/bpm/core/bpmInst/start.do?solId=${obj.solId}\" target=\"_blank\">${obj.name}</a></p>\r\n						</dd>\r\n						</#list>\r\n				</dl>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>', 'portalScript.getPortalMySolList(colId);', 'NO', '1', '1', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2400000011589005', '漏斗报表图', 'ldbbt', '', '', '<div id=\"ldbbt\" class=\"colId_${colId}\" colId=\"${colId}\" style=\"background: #fff;\">\n<div id=\"ldbbtChart\" style=\"width:100%;height:360px;\" ></div>\n<div class=\"script\">\n <script type=\"text/javascript\">\n        // 基于准备好的dom，初始化echarts实例\n        var ldChart = echarts.init(document.getElementById(\'ldbbtChart\'));\n\n        // 指定图表的配置项和数据\n      option = {\n    title : {\n        text: \'漏斗图\',\n        subtext: \'纯属虚构\'\n    },\n    tooltip : {\n        trigger: \'item\',\n        formatter: \"{a} <br/>{b} : {c}%\"\n    },\n    legend: {\n        data : [\'展现\',\'点击\',\'访问\',\'咨询\',\'订单\']\n    },\n    calculable : true,\n    series : [\n        {\n            name:\'漏斗图\',\n            type:\'funnel\',\n            width: \'40%\',\n            data:[\n                {value:60, name:\'访问\'},\n                {value:40, name:\'咨询\'},\n                {value:20, name:\'订单\'},\n                {value:80, name:\'点击\'},\n                {value:100, name:\'展现\'}\n            ]\n        },\n        {\n            name:\'金字塔\',\n            type:\'funnel\',\n            x : \'50%\',\n            sort : \'ascending\',\n            itemStyle: {\n                normal: {\n                    // color: 各异,\n                    label: {\n                        position: \'left\'\n                    }\n                }\n            },\n            data:[\n                {value:60, name:\'访问\'},\n                {value:40, name:\'咨询\'},\n                {value:20, name:\'订单\'},\n                {value:80, name:\'点击\'},\n                {value:100, name:\'展现\'}\n            ]\n        }\n    ]\n};\n                    \n\n        // 使用刚指定的配置项和数据显示图表。\n        ldChart.setOption(option);\n    </script>\n</div>\n</div>', '', 'NO', '1', '1', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2520000000330029', 'Tab页栏目展现', 'test', '', NULL, '', '', NULL, '1', '1', NULL, '1', NULL, '1', 'newsNotice', NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2520000000350005', '新闻公告栏目', 'newsNotice', '', NULL, '<div id=\"noticeList\" class=\"colId_${colId}\" colId=\"${colId}\">\n	<div class=\"widget-box border \" >\n		<div class=\"widget-body\">\n			<div class=\"widget-scroller\" >\n				<dl class=\"modularBox\">\n					<dt>\n						<h1><em class=\"xiaoxi\"></em>${data.title}</h1>\n						<div class=\"icon\">\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\" title=\"更多\"/>\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\" title=\"刷新\"/>\n						</div>\n						<div class=\"clearfix\"></div>\n					</dt>\n					<#list data.obj as obj>\n            				       <dd>\n                                   			<span class=\"project_01\">\n             					        		<b></b>\n                                              		  <a href=\"${ctxPath}/oa/info/infInbox/recPortalGet.do?pkId=${obj.msgId}\" target=\"_blank\">\n                                                      			${obj.subject}\n                                              		  </a>\n                                               </span>\n                                               <span class=\"project_02\">\n                                               			<a href=\"###\">${obj.author}</a>\n                                               </span>\n                                               <span class=\"project_03\">\n											<a href=\"###\">${obj.createTime?string(\'yyyy-MM-dd\')}</a>\n									   </span>\n               				       </dd>\n						</#list>\n				</dl>\n			</div>\n		</div>\n	</div>\n</div>', 'portalScript.getPortalNews(colId)', NULL, '1', '1', NULL, '1', NULL, '1', 'newsNotice', NULL);
INSERT INTO INS_COLUMN_DEF (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, IS_NEWS_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_PUBLIC_, type_, TABGROUPS_) VALUES ('2520000000390002', '公司新闻', 'compNews', '/oa/info/insNews/byColId.do', NULL, '<div id=\"noticeNews\" class=\"colId_${colId}\" colId=\"${colId}\">\n	<div class=\"widget-box border \" >\n		<div class=\"widget-body\">\n			<div class=\"widget-scroller\" >\n				<dl class=\"modularBox\">\n					<dt>\n						<h1><em class=\"xiaoxi\"></em>${data.title}</h1>\n						<div class=\"icon\">\n							<input type=\"button\" id=\"More\" onclick=\"showMore(\'${colId}\',\'${data.title}\',\'${data.url}\')\" title=\"更多\"/>\n							<input type=\"button\" id=\"Refresh\" onclick=\"refresh(\'${colId}\')\" title=\"刷新\"/>\n						</div>\n						<div class=\"clearfix\"></div>\n					</dt>\n					<#list data.obj as obj>\n							   <dd>\n									<span class=\"project_01\">\n										     <em>■</em>\n											  <a href=\"${ctxPath}/oa/info/insNews/get.do?pkId=${obj.newId}\" target=\"_blank\">\n												${obj.subject}\n											  </a>\n									   </span>\n									   <span class=\"project_02\">\n												<a href=\"###\">${obj.author}</a>\n									   </span>\n									   <span class=\"project_03\">\n									<a href=\"###\">${obj.createTime?string(\'yyyy-MM-dd\')}</a>\n							   </span>\n							 </dd>\n					</#list>\n				</dl>\n			</div>\n		</div>\n	</div>\n</div>', 'portalScript.getPortalNews(colId)', NULL, '1', '1', NULL, '1', NULL, '1', 'newsNotice', NULL);
INSERT INTO ins_column_def (COL_ID_, NAME_, KEY_, DATA_URL_, IS_DEFAULT_, TEMPLET_, FUNCTION_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_, IS_NEWS_, IS_PUBLIC_, type_, TABGROUPS_, TREE_ID_) VALUES ('2430000000040063', '默认tab栏目', 'default_tab', '', NULL, '<div class=\"toolTabs\">\n				<div class=\"tabHeader\">\n					<div class=\"tabHeaderLeft\" id=\"tabHeaderLeft\">\n						<ol class=\"tabRollBox\" id=\"tabRollBox\">\n                          <#list data.obj as d>\n							<li colid=\"${d.colId}\" title=\"${d.name}\" url=\"${d.dataUrl}\">${d.name}<b>${d.count}</b></li>\n                            </#list>\n						</ol>\n						\n					</div>\n					<div class=\"tabHeaderRight\">\n						<span class=\"oTabBtn tabBtnLeft\"><</span>\n						<span class=\"oTabBtn tabBtnRight\">></span>\n						<span class=\"more\" onclick=\"showTabMore(this)\"></span>\n						<span class=\"refresh\" onclick=\"refreshTab(this)\"></span>\n					</div>\n				</div>\n				<div class=\"tabContent\">\n                  <#list data.obj as d>\n					<div class=\"contentBox\" >${d.templet}</div>\n                    </#list>\n				</div>\n			</div>', '', '1', '1', '2019-02-12 18:12:00', '1', '2019-02-21 18:06:44', NULL, '1', 'tabcolumn', '2400000003411004,2430000000410492,2430000000410493', '');
