INSERT INTO INS_MSG_DEF (MSG_ID_, COLOR_, URL_, ICON_, CONTENT_, DS_NAME_, DS_ALIAS_, SQL_FUNC_, TYPE_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000007699002', '1', '/bpm/core/bpmTask/myList.do', 'icon-card_agency', '我的待办', '', '', 'import com.redxun.saweb.context.ContextUtil;\r\nimport com.redxun.bpm.core.manager.BpmTaskManager;\r\nimport com.redxun.core.util.AppBeanUtil;\r\nBpmTaskManager bpmTaskManager=AppBeanUtil.getBean(BpmTaskManager.class);\r\nString userId = ContextUtil.getCurrentUserId();\r\nint rtn= bpmTaskManager.getTaskCountsByUserId(userId);\r\nreturn rtn;\r\n', 'function', '1', NULL, NULL, NULL, NULL);
INSERT INTO INS_MSG_DEF (MSG_ID_, COLOR_, URL_, ICON_, CONTENT_, DS_NAME_, DS_ALIAS_, SQL_FUNC_, TYPE_, TENANT_ID_, CREATE_BY_, CREATE_TIME_, UPDATE_BY_, UPDATE_TIME_) VALUES ('2400000011559007', '', '/oa/personal/bpmInst/myAttends.do', ' icon-example', '我的已办', '', '', 'import com.redxun.saweb.context.ContextUtil;\n\nString userId = ContextUtil.getCurrentUserId();\nString sql=\"select count(distinct(JUMP_ID_))from bpm_inst b left join bpm_node_jump c on b.ACT_INST_ID_=c.ACT_INST_ID_ where HANDLER_ID_=\"+userId ;\nreturn sql;\n', 'sql', '1', NULL, NULL, '1', NULL);
